import React from "react";
import { Typography } from "@mui/material";

const Firstpage = (props) => {
  return (
    <header className="header">
      <div className="h2">
        <Typography className="h1" style={{ margin: 10 }}>
          Home
        </Typography>
        <Typography className="h1">9th-10th</Typography>
        <Typography className="h1">11th-12th</Typography>
        <Typography className="h1">Undergraduate</Typography>
        <Typography className="h1">Study Abroad</Typography>
        <Typography className="h1">Blog</Typography>
      </div>
    </header>
  );
};

export default Firstpage;
